import React from "react";
// Assurez-vous de créer un fichier CSS pour le style de la timeline

const SchoolTimeline = () => {
  const schools = [
    {
      name: "École Primaire ABC",
      date: "2000 - 2008",
      description: "J'ai commencé mon parcours scolaire à l'école primaire ABC.",
    },
    {
      name: "Collège XYZ",
      date: "2008 - 2014",
      description: "J'ai poursuivi mes études au collège XYZ où j'ai exploré diverses matières.",
    },
    {
      name: "Université DEF",
      date: "2014 - 2018",
      description: "J'ai obtenu mon diplôme en informatique de l'université DEF.",
    },
  ];

  return (
    <div className="school-timeline-container" id="SchoolTimeline">
      <h1 className="timeline-header">Mon Parcours Scolaire et Universitaire</h1>
      <div className="timeline">
        {schools.map((school, index) => (
          <div key={index} className="timeline-item">
            <div className="timeline-item-content">
              <span className="timeline-item-date">{school.date}</span>
              <h2 className="timeline-item-name">{school.name}</h2>
              <p className="timeline-item-description">{school.description}</p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default SchoolTimeline;
